function loadDb() {
  var secrets = [];
  
  var key1 = 'monkery';
  var key2 = 'email';
  var passphase1 = 'aaaa';
  var passphase2 = 'aaaa';
  
  if (key1 && passphase1) {
    secrets.push({
      name: key1,
      key: passphase1
    });
  }
  if (key2 && passphase2) {
    secrets.push({
      name: key2,
      key: passphase2
    });
  }
  var options = {
    Encryption: {
      secrets: secrets
    }
  };
  
  db = new ydn.db.Storage(db_name, schema, options);
 
}

          loadDb();


